import React, { useState, useRef, useEffect } from 'react';
import styled, { keyframes } from 'styled-components';
import { motion } from 'framer-motion';

const FlagshipProjects = () => {
  const [activeProject, setActiveProject] = useState(0);
  const sectionRef = useRef(null);

  const projects = [
    {
      id: 0,
      title: "Amazon Cloud Migration",
      description: "Created Micro Services based collaboration platform from ground-up that supports Web, Mobile and Hybrid client applications.",
      details: "Our team architected and implemented a comprehensive migration strategy for Amazon's legacy systems to a modern cloud infrastructure. The platform now handles 10x more traffic with 30% reduced costs and improved reliability.",
      tech: ["AWS", "Microservices", "Docker", "Kubernetes", "CI/CD"]
    },
    {
      id: 1,
      title: "Lilac Insights",
      description: "Lilac is a mobile application designed to support expectant mothers throughout their pregnancy journey. Developed by a team of healthcare professionals and app developers.",
      details: "We built an intuitive mobile experience focused on maternal health, featuring personalized care plans, health tracking, and medical guidance. The app has helped over 50,000 mothers with their pregnancy journey.",
      tech: ["React Native", "Firebase", "Node.js", "Healthcare APIs", "Machine Learning"]
    },
    {
      id: 2,
      title: "SoftPOS",
      description: "SoftPOS is a mobile first, mobile only acceptance solution that enables merchants to transform their existing smartphones into Point of Sale terminals with contactless payments acceptance capabilities.",
      details: "Our payment solution eliminates the need for separate POS hardware, allowing any NFC-enabled smartphone to process payments securely. This has helped thousands of small businesses reduce costs and streamline operations.",
      tech: ["NFC", "Android", "Payment Gateways", "Encryption", "Tokenization"]
    }
  ];

  // Animation on scroll
  useEffect(() => {
    const observer = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate-in');
        }
      });
    }, { threshold: 0.2 });

    const section = sectionRef.current;
    if (section) {
      observer.observe(section);
    }

    return () => {
      if (section) {
        observer.unobserve(section);
      }
    };
  }, []);

  // Auto rotate through projects every 10 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      setActiveProject((prev) => (prev + 1) % projects.length);
    }, 10000);

    return () => clearInterval(interval);
  }, [projects.length]);

  const handleProjectSelect = (index) => {
    setActiveProject(index);
  };

  const renderAnimation = () => {
    switch(activeProject) {
      case 0: // Amazon Cloud Migration
        return <AmazonCloudAnimation />;
      case 1: // Lilac Insights
        return <LilacInsightsAnimation />;
      case 2: // SoftPOS
        return <SoftPOSAnimation />;
      default:
        return null;
    }
  };

  return (
    <SectionWrapper ref={sectionRef}>
      <Container>
        <SectionTitle>
          <Highlight>Featured Work</Highlight>
          <MainTitle>Flagship Projects</MainTitle>
          <Subtitle>Transforming ideas into impactful digital experiences</Subtitle>
        </SectionTitle>

        <ProjectsContainer>
          <ProjectTabs>
            {projects.map((project, index) => (
              <ProjectTab 
                key={project.id}
                isActive={activeProject === index}
                onClick={() => handleProjectSelect(index)}
              >
                {project.title}
              </ProjectTab>
            ))}
          </ProjectTabs>

          <ContentSection>
            <ProjectInfo>
              <motion.div
                key={activeProject}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                exit={{ opacity: 0 }}
                transition={{ duration: 0.5 }}
              >
                <ProjectTitle>{projects[activeProject].title}</ProjectTitle>
                <ProjectDescription>{projects[activeProject].description}</ProjectDescription>
                <ProjectDetails>{projects[activeProject].details}</ProjectDetails>
                <TechStack>
                  {projects[activeProject].tech.map((tech, index) => (
                    <TechTag key={index}>{tech}</TechTag>
                  ))}
                </TechStack>
                <LearnMoreButton>View Case Study</LearnMoreButton>
              </motion.div>
            </ProjectInfo>

            <AnimationContainer>
              {renderAnimation()}
            </AnimationContainer>
          </ContentSection>

          <ProjectNavigator>
            <ProjectDots>
              {projects.map((project, index) => (
                <ProjectDot 
                  key={project.id}
                  isActive={activeProject === index}
                  onClick={() => handleProjectSelect(index)}
                />
              ))}
            </ProjectDots>
            <ProjectCounter>
              <CurrentProject>{String(activeProject + 1).padStart(2, '0')}</CurrentProject>
              <TotalProjects>/{String(projects.length).padStart(2, '0')}</TotalProjects>
            </ProjectCounter>
          </ProjectNavigator>
        </ProjectsContainer>
      </Container>
    </SectionWrapper>
  );
};

// Amazon Cloud Migration Animation
const AmazonCloudAnimation = () => {
  return (
    <CloudAnimationWrapper>
      {/* Google Cloud Platform */}
      <GoogleCloud
        as={motion.div}
        initial={{ opacity: 0, scale: 0.8 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.7 }}
      >
        <GoogleLogo>
          <motion.svg width="40" height="32" viewBox="0 0 40 32" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M12.5 6L20 12L27.5 6L32.5 16H7.5L12.5 6Z" fill="#EA4335"/>
            <path d="M27.5 6L20 12L12.5 6L7.5 16H32.5L27.5 6Z" fill="#4285F4"/>
            <path d="M7.5 16L12.5 26L20 20L27.5 26L32.5 16H7.5Z" fill="#34A853"/>
            <path d="M20 20L12.5 26L7.5 16H32.5L27.5 26L20 20Z" fill="#FBBC05"/>
          </motion.svg>
        </GoogleLogo>
        <CloudPlatform>Google Cloud</CloudPlatform>
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: [0, 1, 0] }}
          transition={{ 
            delay: 0.8, 
            duration: 1.5, 
            repeat: Infinity,
            repeatDelay: 3
          }}
        >
          <CloudStatus>Migrating...</CloudStatus>
        </motion.div>
      </GoogleCloud>

      {/* Migration Path Lines */}
      <MigrationLines>
        {[...Array(8)].map((_, i) => (
          <MigrationDot
            key={i}
            as={motion.div}
            animate={{
              x: [0, 200],
              y: [0, Math.sin(i * 0.8) * 10],
              opacity: [0, 1, 1, 0]
            }}
            transition={{
              duration: 2.5,
              delay: i * 0.3,
              repeat: Infinity,
              repeatDelay: 0.5,
              ease: "easeInOut"
            }}
          />
        ))}

        <DottedLine />

        {/* Data Packet Animation */}
        <DataPacket
          as={motion.div}
          initial={{ x: 0, opacity: 0 }}
          animate={{
            x: [0, 200],
            opacity: [0, 1, 1, 0]
          }}
          transition={{
            duration: 3,
            repeat: Infinity,
            repeatDelay: 2,
            ease: "easeInOut"
          }}
        >
          <motion.svg width="20" height="20" viewBox="0 0 20 20" fill="none">
            <rect width="20" height="20" rx="2" fill="#39B8B8" opacity="0.7" />
            <motion.path 
              d="M5 10H15M10 5V15" 
              stroke="white" 
              strokeWidth="2"
              animate={{ rotate: 90 }}
              transition={{ duration: 0.8, repeat: Infinity, repeatDelay: 1 }}
            />
          </motion.svg>
        </DataPacket>
      </MigrationLines>

      {/* AWS Cloud */}
      <AWSCloud
        as={motion.div}
        initial={{ opacity: 0, scale: 0.8 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.7, delay: 0.5 }}
      >
        <AWSLogo>
          <motion.svg width="48" height="32" viewBox="0 0 48 32" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M14.5 6C11 6 8 7.5 8 10.5C8 13 10.5 15 14.5 15C18 15 21 13.5 21 10.5C21 8 18 6 14.5 6Z" fill="#FF9900"/>
            <path d="M33.5 6C30 6 27 7.5 27 10.5C27 13 29.5 15 33.5 15C37 15 40 13.5 40 10.5C40 8 37 6 33.5 6Z" fill="#FF9900"/>
            <path d="M24 17C15 17 8 18.5 8 22.5C8 26 15 28 24 28C33 28 40 26.5 40 22.5C40 19 33 17 24 17Z" fill="#FF9900"/>
            <path d="M24 21C19.5 21 16 21.5 16 23C16 24 19 25 24 25C29 25 32 24.5 32 23C32 22 28.5 21 24 21Z" fill="white"/>
          </motion.svg>
        </AWSLogo>
        <CloudPlatform>AWS</CloudPlatform>
        <motion.div
          initial={{ scale: 0, opacity: 0 }}
          animate={{ 
            scale: [0, 1.2, 1], 
            opacity: [0, 1] 
          }}
          transition={{ 
            delay: 3, 
            duration: 0.8,
            repeat: Infinity,
            repeatDelay: 5
          }}
        >
          <SuccessBadge> Migration Complete</SuccessBadge>
        </motion.div>
      </AWSCloud>
    </CloudAnimationWrapper>
  );
};

// Lilac Insights Animation
const LilacInsightsAnimation = () => {
  return (
    <LilacAnimationWrapper>
      <Phone
        as={motion.div}
        initial={{ y: 50, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.8 }}
      >
        <PhoneFrame>
          <PhoneHeader />
          <PhoneScreen>
            <AppBackground>
              <AppLogo>
                <motion.div
                  initial={{ scale: 0.2, opacity: 0 }}
                  animate={{ scale: 1, opacity: 1 }}
                  transition={{ delay: 1, duration: 1 }}
                >
                  <LilacIcon />
                </motion.div>
              </AppLogo>

              <WombContainer
                as={motion.div}
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ delay: 1.5, duration: 0.8 }}
              >
                <WombOutline />
                <Baby
                  as={motion.div}
                  animate={{ 
                    rotate: [0, 5, -5, 0],
                    y: [0, -3, 3, 0] 
                  }}
                  transition={{ 
                    repeat: Infinity,
                    duration: 4,
                    ease: "easeInOut"
                  }}
                >
                  <BabyFigure />
                </Baby>
              </WombContainer>

              <motion.div
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 2, duration: 0.8 }}
              >
                <AppTitle>Lilac Insights</AppTitle>
                <AppSubtitle>Your pregnancy companion</AppSubtitle>
              </motion.div>
            </AppBackground>
          </PhoneScreen>
          <PhoneFooter />
        </PhoneFrame>
      </Phone>
    </LilacAnimationWrapper>
  );
};

// SoftPOS Animation
const SoftPOSAnimation = () => {
  const [isAnimating, setIsAnimating] = useState(true);

  useEffect(() => {
    // Restart animation periodically
    const interval = setInterval(() => {
      setIsAnimating(false);
      setTimeout(() => setIsAnimating(true), 100);
    }, 5000);

    return () => clearInterval(interval);
  }, []);

  return (
    <SoftPOSAnimationWrapper>
      {isAnimating && (
        <>
          <Hand
            as={motion.div}
            initial={{ x: -100, y: 50, opacity: 0 }}
            animate={{ x: 0, y: 0, opacity: 1 }}
            transition={{ duration: 1 }}
          >
            <HandSvg />
            <PhoneInHand>
              <PhoneScreen>
                <PaymentApp>
                  <CardAnimation
                    as={motion.div}
                    animate={{ 
                      y: [0, -10, 0],
                      rotate: [0, 5, 0]
                    }}
                    transition={{ 
                      repeat: Infinity,
                      duration: 1.5,
                      ease: "easeInOut"
                    }}
                  >
                    <CardFront>
                      <CardChip />
                      <CardNumber>**** **** **** 4242</CardNumber>
                    </CardFront>
                  </CardAnimation>

                  <PayButton
                    as={motion.div}
                    animate={{ scale: [1, 1.1, 1] }}
                    transition={{ 
                      delay: 2,
                      duration: 0.5
                    }}
                  >
                    TAP TO PAY
                  </PayButton>
                </PaymentApp>
              </PhoneScreen>
            </PhoneInHand>
          </Hand>

          <POSTerminal
            as={motion.div}
            initial={{ x: 100, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ duration: 1 }}
          >
            <TerminalScreen />
            <TerminalBase>
              <NFCSymbol>
                <motion.div
                  animate={{ 
                    opacity: [0.4, 1, 0.4],
                    scale: [0.8, 1.1, 0.8]
                  }}
                  transition={{ 
                    repeat: Infinity,
                    duration: 2
                  }}
                >
                  <NFCWaves />
                </motion.div>
              </NFCSymbol>
            </TerminalBase>
          </POSTerminal>

          <PaymentComplete
            as={motion.div}
            initial={{ opacity: 0, scale: 0 }}
            animate={{ 
              opacity: [0, 1, 1, 0],
              scale: [0, 1.2, 1.3, 0]
            }}
            transition={{ 
              delay: 3,
              duration: 1.5,
              times: [0, 0.3, 0.8, 1]
            }}
          >

          </PaymentComplete>
        </>
      )}
    </SoftPOSAnimationWrapper>
  );
};

// Styled Components
const fadeIn = keyframes`
  from {
    opacity: 0;
    transform: translateY(30px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const SectionWrapper = styled.section`
  padding: 120px 20px;
  background: #fff;
  position: relative;
  overflow: hidden;
  opacity: 0;
  transform: translateY(30px);
  transition: opacity 0.8s ease, transform 0.8s ease;

  &.animate-in {
    opacity: 1;
    transform: translateY(0);
  }
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  position: relative;
  z-index: 2;
`;

const SectionTitle = styled.div`
  text-align: center;
  margin-bottom: 80px;
`;

const Highlight = styled.h3`
  font-size: 1.2rem;
  text-transform: uppercase;
  letter-spacing: 3px;
  margin-bottom: 16px;
  color: #39B8B8;
  font-weight: 600;
`;

const MainTitle = styled.h2`
  font-size: clamp(2rem, 4vw, 2.8rem);
  font-weight: 700;
  color: #1a1a2e;
  margin: 0;
  line-height: 1.2;
`;

const Subtitle = styled.p`
  font-size: clamp(1.1rem, 2vw, 1.3rem);
  color: #555;
  font-weight: 500;
  margin-top: 16px;
`;

const ProjectsContainer = styled.div`
  margin-top: 60px;
  position: relative;
`;

const ProjectTabs = styled.div`
  display: flex;
  justify-content: center;
  gap: 30px;
  margin-bottom: 50px;

  @media (max-width: 768px) {
    gap: 15px;
    flex-wrap: wrap;
  }
`;

const ProjectTab = styled.button`
  background: transparent;
  border: none;
  font-size: 1.2rem;
  font-weight: 600;
  padding: 10px 20px;
  cursor: pointer;
  position: relative;
  color: ${props => props.isActive ? '#39B8B8' : '#555'};
  transition: color 0.3s ease;

  &:after {
    content: '';
    position: absolute;
    bottom: 0;
    left: 50%;
    transform: translateX(-50%);
    width: ${props => props.isActive ? '70%' : '0%'};
    height: 3px;
    background: #39B8B8;
    transition: width 0.3s ease;
  }

  &:hover {
    color: #39B8B8;

    &:after {
      width: 50%;
    }
  }
`;

const ContentSection = styled.div`
  display: flex;
  min-height: 400px;
  gap: 40px;

  @media (max-width: 768px) {
    flex-direction: column;
  }
`;

const ProjectInfo = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;

  @media (max-width: 768px) {
    order: 2;
  }
`;

const ProjectTitle = styled.h3`
  font-size: 2.2rem;
  font-weight: 700;
  color: #1a1a2e;
  margin-bottom: 20px;
`;

const ProjectDescription = styled.p`
  font-size: 1.1rem;
  line-height: 1.6;
  color: #333;
  margin-bottom: 20px;
`;

const ProjectDetails = styled.p`
  font-size: 1rem;
  line-height: 1.6;
  color: #666;
  margin-bottom: 30px;
`;

const TechStack = styled.div`
  display: flex;
  gap: 10px;
  flex-wrap: wrap;
  margin-bottom: 30px;
`;

const TechTag = styled.span`
  background: #f0f8ff;
  color: #39B8B8;
  border: 1px solid #cee5ff;
  padding: 6px 12px;
  border-radius: 20px;
  font-size: 0.9rem;
  font-weight: 500;
`;

const LearnMoreButton = styled.button`
  background: linear-gradient(90deg, #39B8B8, #00A4C0);
  color: white;
  border: none;
  padding: 12px 24px;
  font-weight: 600;
  border-radius: 30px;
  cursor: pointer;
  transition: all 0.3s ease;
  align-self: flex-start;

  &:hover {
    transform: translateY(-3px);
    box-shadow: 0 10px 20px rgba(0, 164, 192, 0.2);
  }
`;

const AnimationContainer = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
  min-height: 400px;
  background: #f8f9fa;
  border-radius: 20px;
  overflow: hidden;
  position: relative;

  @media (max-width: 768px) {
    min-height: 300px;
    order: 1;
  }
`;

const ProjectNavigator = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-top: 30px;
`;

const ProjectDots = styled.div`
  display: flex;
  gap: 10px;
`;

const ProjectDot = styled.button`
  width: 12px;
  height: 12px;
  border-radius: 50%;
  background: ${props => props.isActive ? '#39B8B8' : '#ddd'};
  border: none;
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    transform: scale(1.2);
  }
`;

const ProjectCounter = styled.div`
  display: flex;
  align-items: baseline;
  font-family: monospace;
`;

const CurrentProject = styled.span`
  font-size: 1.5rem;
  font-weight: 700;
  color: #39B8B8;
`;

const TotalProjects = styled.span`
  font-size: 1rem;
  color: #999;
`;

// Amazon Cloud Migration Animation Styles
const CloudAnimationWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  position: relative;
`;

const GoogleCloud = styled.div`
  position: absolute;
  left: 10%;
  top: 40%;
  transform: translateY(-50%);
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const GoogleLogo = styled.div`
  background: white;
  border-radius: 50%;
  width: 80px;
  height: 80px;
  display: flex;
  align-items: center;
  justify-content: center;
  box-shadow: 0 6px 16px rgba(0, 0, 0, 0.1);
`;

const CloudPlatform = styled.div`
  margin-top: 10px;
  font-weight: 600;
  font-size: 14px;
  color: #333;
`;

const MigrationLines = styled.div`
  position: relative;
  width: 60%;
  height: 5px;
  margin: 0 auto;
`;

const DottedLine = styled.div`
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  width: 100%;
  height: 2px;
  background: repeating-linear-gradient(
    to right,
    #ccc,
    #ccc 5px,
    transparent 5px,
    transparent 10px
  );
`;

const MigrationDot = styled.div`
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  width: 10px;
  height: 10px;
  border-radius: 50%;
  background: #39B8B8;
`;

const AWSCloud = styled.div`
  position: absolute;
  right: 10%;
  top: 40%;
  transform: translateY(-50%);
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const AWSLogo = styled.div`
  background: white;
  border-radius: 12px;
  width: 80px;
  height: 80px;
  display: flex;
  align-items: center;
  justify-content: center;
  box-shadow: 0 6px 16px rgba(0, 0, 0, 0.1);
`;

// Lilac Insights Animation Styles
const LilacAnimationWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Phone = styled.div`
  position: relative;
  width: 230px;
  height: 450px;
`;

const PhoneFrame = styled.div`
  width: 100%;
  height: 100%;
  border-radius: 36px;
  border: 8px solid #333;
  overflow: hidden;
  position: relative;
  background: #fff;
  box-shadow: 0 15px 30px rgba(0, 0, 0, 0.2);
`;

const PhoneHeader = styled.div`
  height: 20px;
  width: 100%;
  background: #333;
  position: relative;

  &:after {
    content: '';
    position: absolute;
    width: 50px;
    height: 12px;
    background: #333;
    top: 20px;
    left: 50%;
    transform: translateX(-50%);
    border-bottom-left-radius: 10px;
    border-bottom-right-radius: 10px;
  }
`;

const PhoneScreen = styled.div`
  width: 100%;
  height: calc(100% - 40px);
  background: #fff;
  overflow: hidden;
`;

const PhoneFooter = styled.div`
  height: 20px;
  width: 100%;
  background: #333;
  position: absolute;
  bottom: 0;

  &:before {
    content: '';
    position: absolute;
    width: 50px;
    height: 5px;
    background: #555;
    bottom: 7px;
    left: 50%;
    transform: translateX(-50%);
    border-radius: 5px;
  }
`;

const AppBackground = styled.div`
  width: 100%;
  height: 100%;
  background: linear-gradient(135deg, #FFF5FA, #F9F0FF);
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 20px;
`;

const AppLogo = styled.div`
  margin-bottom: 20px;
`;

const LilacIcon = styled.div`
